// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import About from './components/About';  // Example component
import Challenges from './components/Challenges';  // Example component
import Solutions from './components/Solutions';  // Example component
import FutureScope from './components/FutureScope';  // Example component
import ExploreMore from './components/ExploreMore';  // Example component

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Switch>
          <Route path="/about" component={About} />
          <Route path="/challenges" component={Challenges} />
          <Route path="/solutions" component={Solutions} />
          <Route path="/futureScope" component={FutureScope} />
          <Route path="/exploreMore" component={ExploreMore} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
